import React from "react";
import styles from "./SearchBar.module.css";
import {useState} from "react";

function SearchBar(){
    const [input,setInput] = useState("")

    function handleChange(e){
        e.preventDefault()
        setInput(e.target.value)
    }

    function getPokemon(){
        e.preventDefault()
    }

    return (
        <div className="container">
            <input onChange={(e)=>handleChange(e)} className={styles.input} type="text" placeholder="Search pokemon..."></input>
            <button onClick={(e)=>getPokemon(e)}>Search</button>
        </div>
    ) 
}

export default SearchBar;
